<script>
  window.onload = function () {
    // Redirect if not logged in
    if (localStorage.getItem("loggedIn") !== "true") {
      window.location.href = "index.html";
    }

    // Total session duration: 10 minutes
    const sessionDuration = 10 * 60 * 1000;
    const logoutTime = Date.now() + sessionDuration;
    sessionStorage.setItem("logoutTime", logoutTime);

    const timerElement = document.getElementById("session-timer");

    const countdown = setInterval(() => {
      const remaining = parseInt(sessionStorage.getItem("logoutTime")) - Date.now();

      if (remaining <= 0) {
        clearInterval(countdown);
        localStorage.removeItem("loggedIn");
        alert("Session expired. Logging out.");
        window.location.href = "index.html";
      } else {
        const minutes = Math.floor(remaining / (60 * 1000));
        const seconds = Math.floor((remaining % (60 * 1000)) / 1000);
        timerElement.textContent = `Session expires in ${minutes}m ${seconds < 10 ? '0' : ''}${seconds}s`;
      }
    }, 1000);
  };
</script>

    const keyFixMap = {
      "Name": "STUDENT NAME",
      "Gender": "GENDER",
      "City": "CITY",
      "University": "UNIVERSITY",
      "Year": "JOINING YEAR"
    };

    const cleanedStudents = students.map(student => {
      const fixedStudent = {};
      for (const key in student) {
        const newKey = keyFixMap[key] || key;
        fixedStudent[newKey] = student[key];
      }
      return fixedStudent;
    });

    $(document).ready(function () {
      const table = $('#studentsTable').DataTable({
        data: cleanedStudents,
        columns: [
          { data: 'STUDENT NAME' },
          { data: 'GENDER' },
          { data: 'CITY' },
          { data: 'UNIVERSITY' },
          { data: 'JOINING YEAR' },
          { data: 'NUMBER 1' },
          { data: 'MOBILE NUMBER 2' },
          { data: 'EMAIL ADDRESS' }
        ]
      });

      $('#genderFilter').on('change', function () {
        table.column(1).search(this.value).draw();
      });
      $('#cityFilter').on('change', function () {
        table.column(2).search(this.value).draw();
      });
      $('#universityFilter').on('change', function () {
        table.column(3).search(this.value).draw();
      });
      $('#yearFilter').on('change', function () {
        table.column(4).search(this.value).draw();
      });

      function populateSelectOptions(columnIndex, selectId, label = "All") {
        const uniqueData = table.column(columnIndex).data().unique().sort();
        const select = $(selectId);
        select.empty();
        select.append(`<option value="">${label}</option>`);
        uniqueData.each(function (d) {
          if (d) select.append(`<option value="${d}">${d}</option>`);
        });
      }

      populateSelectOptions(2, '#cityFilter', 'All Cities');
      populateSelectOptions(3, '#universityFilter', 'All Universities');
      
    });
    
  </script>
